import React, { useState } from "react";

const Project = ({ id, screenshot, name, category, info }) => {
  console.log("test");
  return (
    
    <>
      <article className="single-project">
        <p>{id}</p>
        <img src={screenshot} alt={name} />

        <footer>
          <div className="project-info">
            <h4>{name}</h4>
            <h4>{category}</h4>
          </div>
        </footer>
      </article>
    </>
  );
};

export default Project;
